import React, {Component} from 'react';
import {Link, NavLink} from "react-router-dom";

class Navbar extends Component{

    state = {
        showOverlay: true
    };

    closeOverlay = () => {
        this.setState({
            showOverlay: false
        });
    };

    render() {

        return (
            <div>

                <div className="navBarContainer">

                    <div className="cvaNavLogoContainer">
                        <Link to="/" className="cvaHome">
                            <div className="image-wrapper2">
                                <img src={require('../assets/images/homelogo.png')}/>
                            </div>
                        </Link>
                    </div>

                    <div className="menuButtonWrapper">
                        <button className="menuButton" href="#menuOverlay">
                            <img src={require('../assets/icons/mobile/button_mobilemenu.png')}/>

                            <div id="menuOverlay" className="menuOverlayContainer">

                                <div className="crossContainer">
                                    <span className={'cross'} onClick={this.closeBox}>X</span>
                                </div>

                                <div className="OverlayLinksContainer">
                                    <div className="OverlayLinks"><NavLink to="/Home" className="OverlayLinks">
                                        <p> Home </p></NavLink></div>
                                    <div className="OverlayLinks"><NavLink to="/Professionals" className="OverlayLinks">
                                        <p> Professionals </p></NavLink></div>
                                    <div className="OverlayLinks"><NavLink to="/Begeleiding" className="OverlayLinks">
                                        <p> Begeleiding </p></NavLink></div>
                                    <div className="OverlayLinks"><NavLink to="/Informatie" className="OverlayLinks">
                                        <p> Informatie </p></NavLink></div>
                                    <div className="OverlayLinks"><NavLink to="Contact" className="OverlayLinks">
                                        <p>Contact</p></NavLink></div>
                                </div>
                            </div>

                        </button>
                    </div>


                    <div className="buttonListContainer">

                        <div className="buttonContainer">
                            <NavLink to="/Begeleiding" className="cvaNavButtons"> Begeleiding </NavLink>
                        </div>

                        <div className="buttonContainer">
                            <NavLink to="/Professionals" className="cvaNavButtons"> Professionals </NavLink>
                        </div>

                        <div className="buttonContainer">
                            <NavLink to="/Informatie" className="cvaNavButtons"> Informatie </NavLink>
                        </div>

                        <div className="buttonContainerContacts">
                            <NavLink to="/Contact" className="cvaNavButtons"> Contact </NavLink>
                        </div>

                    </div>

                </div>

                <div className="navBarContainer static-push">
                </div>

            </div>
        );
    }
};

export default Navbar;
